<!DOCTYPE html><html>
<head>
<meta charset="utf-8">
<title>404 - Pass Doradztwo</title>
<link href='http://fonts.googleapis.com/css?family=Dosis:400,700&subset=latin,latin-ext' rel='stylesheet' type='text/css'>
<style>
body {
background: rgb(230,230,230);
color: rgb(40,40,40);
font-family: 'Dosis', Verdana;
font-size: 20px;
}
h2 {
font-weight: bold;
font-size: 32px;
}
a {
color: #43b94b;
text-decoration: none;
}
a:hover {
font-weight: bold;
}
.container {
background: white;
border: solid 2px rgb(240,240,240);
box-shadow: 0px 0px 100px 40px rgba(255, 255, 255, 0.45);
min-width: 400px;
min-height: 200px;
position: absolute;
}
@media screen {
.container {
left: 40%;
top: 40%;
margin-top: -10%;
margin-left: -10%;
padding: 40px;
}
}
@media only screen and (max-width: 600px) {
.container {
left: 1%;
top: 5%;
margin-top: 0%;
margin-left: 0%;
