}
}
@media only screen and (max-width: 900px) {
.container {
left: 40%;
top: 40%;
margin-top: -20%;
margin-left: -25%;
padding: 10px;
}
}
.left-col {
float: left;
width: 30%;
}
.right-col {
float: right;
width: 65%;
}
.logo {
width: 100%;
}
</style>
</head>
<body>
<div class="container">
<div class="left-col">
<img class="logo" src="data:image/png;base64," />
</div>
<div class="right-col">
<h2>
Blad 404
</h2>
<span>
Przepraszamy, nie udalo sie znalezc zadanej strony.<br />
